<html xmlns="http://www.w3.org/1999/xhtml">
<head>
    <style>
        body {
            display: grid;
            justify-content: center;
            grid-template-columns: 80%;
            justify-content: center;
        }

        .container {
            border-width: 1px;
            border-style: solid;
            padding: 20px;
            row-gap: 10px;
            display: grid;
            grid-template-rows: 100px auto 1fr;
        }

            .container header {
                display: flex;
                align-items: center;
                justify-content: space-between;
            }

            .container .employeeInfo table {
                width: 90%;
            }

                .container .employeeInfo table td:first-child {
                    width: 200px;
                    font-weight: bold;
                }

                .container .employeeInfo table td:nth-child(2) {
                    border-bottom-style: solid;
                    border-bottom-width: 1px;
                }

            .container .evaluations {
                display: flex;
                flex-direction: column;
                row-gap: 10px;
            }

                .container .evaluations .evaluation {
                }

                    .container .evaluations .evaluation .title {
                        background-color: gray;
                        width: 100%;
                    }

                    .container .evaluations .evaluation .itemsEvaluated {
                    }

                    .container .evaluations .evaluation .evaluatorComments {
                    }

                    .container .evaluations .evaluation .evaluationSystemInfo {
                    }
    </style>
</head>
